import React from "react";
import LandingPage from "./pages/Landing";
import Dashboard from "./pages/Dashboard";
import { Switch, Route } from "react-router-dom";
import "./App.css";

const App = () => {
  return (
    <>
      <Switch>
        <Route path="/home">
          <Dashboard />
        </Route>
        <Route path="/">
          <LandingPage />
        </Route>
      </Switch>
    </>
  );
};

export default App;
